additional_information:
effective September 24, 2020 our hours remain 7:30 am to 6:00 pm however appointments via preregistration are now required. Residents who require testing must preregister via an online form for the following day - https://covidtestregistration.grhosp.on.ca/ - and if they need assistance can call 226-806-5690.
We are also now directing that residents should only seek testing if:
•	Showing COVID-19 symptoms; 
•	Have been exposed to a confirmed case of the virus, as informed by your public health unit or exposure notification through the COVID Alert app; 
•	A resident or work in a setting that has a COVID-19 outbreak, as identified and informed by your local public health unit; and 
•	Eligible for testing as part of a targeted testing initiative directed by the Ministry of Health or the Ministry of Long-Term Care.

Effective Monday, April 4th, 2022 the PUMA clinic will be moving to the Paediatric Outpatient area 3rd Floor at Met Campus.

• An appointment will be booked on the current PUMA/WRH website or by phone (519) 254-5577 ext. 55531;

o  The clinic will run from 8am – 4pm, Monday to Friday;

o  One appointment each hour will be available with the last appointment at 3pm;

o  Appointment bookings are opened 2 days in advance.



Opening August 31, 2021. Metropolitan Campus located directly outside of ED in portable testing center.
